    </g>
    <g id="btn-microondas" class="la-btn-active-ref la-btn-specter" title-ref="Microondas" number-ref="Ref. 05" data-ref="A radiao eletromagntica produzida na regio do espectro entre 1 mm e 30 cm  denominada de microonda. Esse tipo de radiao tem grandes aplicaes prticas, por exemplo, para aquecer substncias que so compostas principalmente por gua. Um dos seus maiores usos  no forno de microondas.">
